import { useEffect, useState } from "react";
import "../../styles/AvailableProducts.css"
import Product from "./Product";

const AvailableProducts = (props) => {
    const [products, setProducts] = useState([])
    useEffect(() => {
        const fetchData = async () => {
            const response = await fetch('https://front-test-api.herokuapp.com/api/product');
            const responseData = await response.json();

            const loadedProduct = [];

            for (const key in responseData) {
                console.log("ðŸš€ ~ file: AvailableProducts.js ~ line 15 ~ fetchData ~ key", key)
                loadedProduct.push({
                    id: key,
                    brand: responseData[key].brand,
                    price: responseData[key].price,
                    model: responseData[key].model,
                    imgUrl: responseData[key].imgUrl
                })
            }
            console.log("ðŸš€ ~ file: AvailableProducts.js ~ line 13 ~ fetchData ~ loadedProduct", loadedProduct)
            setProducts(loadedProduct)
        }
        fetchData()
    }, [])
    return (
        <section className="feapi-section">
            <ul className="feapi-list">
                {products.map(product => {
                    return <Product key={product.id} id={product.id} name={product.name} price={product.price} />
                })}
            </ul>
        </section>
    )
}

export default AvailableProducts;
